import styled from "styled-components";

import Link from "next/link";

const HeaderWrapper = styled.div`
	max-height: 70px;
	flex: 1;
`;

const HeaderWrapperPC = styled.div`
	display: flex;
	justify-content: center;
	align-items: center;
	flex-flow: row wrap;
	width: 100%;
	padding: 12px;
	background: ${props => props.theme.primaryLight};
	max-height: 70px;
	@media screen and (max-width: ${props => props.theme.tablet}) {
		padding: 25px 70px;
		display: none;
		justify-content: flex-end;
		img {
			flex: 1;
		}
	}
	@media screen and (min-width: ${props => props.theme.tablet}) {
		display: flex;
	}
`;

const HeaderWrapperMobile = styled.div`
	display: flex;
	justify-content: space-between;
	align-items: center;
	flex-flow: row wrap;
	box-shadow: 0px 1px 1px 1px rgba(0, 0, 0, 0.1);
	background: ${props => props.theme.primaryLight};
	a {
		margin-right: 50px;
	}
	@media screen and (max-width: ${props => props.theme.tablet}) {
		padding: 25px 0;
		display: flex;
	}
	@media screen and (min-width: ${props => props.theme.tablet}) {
		display: none;
	}
`;

const Header = () => (
	<HeaderWrapper>
		{/* <HeaderWrapperMobile>
      <HamburgerMenu toggle />
      <Logo />
      <div />
    </HeaderWrapperMobile> */}
		<HeaderWrapperPC>
			<Link href="/contact">
				<a>CONTACT US</a>
			</Link>
		</HeaderWrapperPC>
	</HeaderWrapper>
);

export default Header;
